import React from "react";
import { v4 } from "uuid";

const blogs = [
  { id: v4(), title: "Blog 1", body: "Body 1" },
  { id: v4(), title: "Blog 2", body: "Body 2" }
];

const Blogs = () => {


  return blogs.length ? (
    <section>
      <ul>
        { blogs.map( blog => {
          return <li key={blog.id}>{blog.title}</li>;
        })}
      </ul>
    </section>
  ) : (
    <section>
      <p>No available blogs.</p>
    </section>
  );
}

export default Blogs;
